import { Box } from "@mui/material/";
import theme from "./theme";

export function Sidebar() {
  return (
    <Box
      sx={{
        position: "absolule",
        height: "100vh",
        width: "10%",
        background: theme.palette.secondary.main,
        color: "white",
        zIndex: 2,
      }}
    >
      Games Menu Will Be On This Sidebar
    </Box>
  );
}
